import Card from 'react-bootstrap/Card'
import React from 'react';

function MyProject(props) {
    return(
        <Card style={{ width: '50rem' }}>
        <Card.Img variant="top" src={props.imageURL} wdith="400" height="200"/>
        <Card.Body>
          <Card.Title>{props.projectName}</Card.Title>
          <Card.Text>
            {props.projectDescription} <br/> Langugages used: {props.langugages}
          </Card.Text>
          <Card.Link href={props.repoLink}>Repository Link</Card.Link>
          <Card.Link href={props.deployedLink}>Deployed Link</Card.Link>
        </Card.Body>
      </Card>
    )
}

export default MyProject;
